import React from "react";
import FriendListItem from "./FriendListItem";
import './FriendList.css';


const FriendList = ({friends}) => {
  return (
    <>
      <ul className="friendsLis">
        {friends.map(friend => (
          
          <FriendListItem key={friend.id} {...friend} />
          
        ))
      }
      
        
      </ul>
    </>
  );
};

export default FriendList;
